import React from 'react';

const MandalArtTable = ({aa, ab, ac, ba, bb, bc, ca, cb, cc}) => {

    state = {
        name: ''
    }

    let list = [[aa, ab, ac], [ba, bb, bc], [ca, cb, cc]];

    return (
        <table>
            {list.map((goalList, index) => (
                <tr key={index}>
                    {goalList.map((goal, index) => (
                        <td key={index}><input value={goal}/></td>
                    ))}
                </tr>
            ))}
        </table>
    );
};

export default MandalArtTable;
